import React from "react";

class NumArray extends React.Component {
  state = {
    todosList: [
      {
        id: 1,
        task: "task 1",
      },
      {
        id: 2,
        task: "task 2",
      },
      {
        id: 3,
        task: "task 3",
      },
      {
        id: 4,
        task: "task 4",
      },
    ],
  };
}

export default NumArray;
